import ExpensesComponent from "./components/ExpensesComponent";

function App() {
  const expenses = [{
    title: 'Car Insurance',
    amount: 294.67,
    date: new Date(2022, 2, 28)
  },
  {
    title: 'Smart TV',
    amount: 799.99,
    date: new Date(2021, 9, 15)
  },
  {
    title: 'Laptop',
    amount: 1190.00,
    date: new Date(2021, 8, 6)
  }]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpensesComponent items={expenses}/>
    </div>
  );
}

export default App;
